var dateControl = document.querySelector('input[type="date"]');

dateControl.onchange = function() {
    console.log("DateWidget: " + dateControl.value);
    if( datasources.Temperature ) {
        var start = dateControl.value ;
        // add the end date to one day further
        var startd = new Date(start);
        var day = startd.getDate() + 2
        var month = startd.getMonth() + 1
        var year = startd.getFullYear()
        var endd = year + "-" + month + "-" + day ;
        //console.log(endd) ;
        //var end = "2017-10-30" ; //dateControl.value ;
        var vals = { "deviceid": "20000", "start": start, "end": endd };
        //console.log(vals) ;
        datasources.Temperature.sendData(vals) ;
    }
}

